import { useState, useEffect } from "react";
import { BarChart, Bar, XAxis, YAxis, Tooltip, ResponsiveContainer, Legend } from "recharts";
import { Card, CardContent } from "@/components/ui/card";
import { Tabs, TabsList, TabsTrigger } from "@/components/ui/tabs";
import { ArrowUpRight, DollarSign, Users } from "lucide-react";
import axios from "axios";

export default function Graph() {
  const [activeTab, setActiveTab] = useState("monthly");
  const [totalMembers, setTotalMembers] = useState(0);
  const [membershipPrice, setMembershipPrice] = useState(0);
  const [revenueData, setRevenueData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const membersRes = await axios.get("http://localhost:5000/api/members");
        const membershipsRes = await axios.get("http://localhost:5000/api/memberships");
        
        setTotalMembers(membersRes.data.totalMembers);
        setMembershipPrice(membershipsRes.data.price);

        // Calculate revenue using total members * membership price
        const calculatedRevenue = totalMembers * membershipPrice;
        
        // Generate chart data
        setRevenueData([
          { period: "Jan", members: totalMembers, revenue: calculatedRevenue },
          { period: "Feb", members: totalMembers + 5, revenue: calculatedRevenue * 1.1 },
          { period: "Mar", members: totalMembers + 10, revenue: calculatedRevenue * 1.2 },
        ]);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };
    fetchData();
  }, [totalMembers, membershipPrice]);

  return (
    <div className="p-6 space-y-6">
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        <Card className="p-6 bg-gradient-to-r from-blue-500 to-cyan-500 text-white shadow-lg">
          <Users size={28} />
          <h2 className="text-xl font-semibold mt-2">Total Members</h2>
          <p className="text-2xl font-bold">{totalMembers}</p>
        </Card>
        <Card className="p-6 bg-gradient-to-r from-yellow-500 to-orange-500 text-white shadow-lg">
          <DollarSign size={28} />
          <h2 className="text-xl font-semibold mt-2">Membership Price</h2>
          <p className="text-2xl font-bold">${membershipPrice}</p>
        </Card>
        <Card className="p-6 bg-gradient-to-r from-purple-600 to-indigo-600 text-white shadow-lg">
          <ArrowUpRight size={28} />
          <h2 className="text-xl font-semibold mt-2">Estimated Revenue</h2>
          <p className="text-2xl font-bold">${totalMembers * membershipPrice}</p>
        </Card>
      </div>

      <Tabs defaultValue="monthly" onValueChange={setActiveTab} className="w-full">
        <TabsList className="flex justify-center gap-4 bg-gray-100 p-2 rounded-lg">
          <TabsTrigger value="monthly">Monthly</TabsTrigger>
        </TabsList>
      </Tabs>

      <Card className="p-6 shadow-lg">
        <CardContent>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={revenueData}>
              <XAxis dataKey="period" stroke="#8884d8" />
              <YAxis />
              <Tooltip />
              <Legend />
              <Bar dataKey="members" fill="#2563EB" barSize={40} />
              <Bar dataKey="revenue" fill="#4F46E5" barSize={40} />
            </BarChart>
          </ResponsiveContainer>
        </CardContent>
      </Card>
    </div>
  );
}
